import React,{Component} from 'react';
import './App.css';
import Pepi from './pepi.js'
import Appa from './Appa.js'

const App = () => {
  return (
    <div className='App-Wrapper'>
      <div className='App1'>1 Mega Facebook Vkontakte</div>
      <div className='App2'>22 Ultra Telegram Viber What's up? Meeeeen</div>
      <div><a>Profile</a></div>
      <div><a>Messages</a></div>
      <div><a>News</a></div>
      <div><a>Music</a></div>
      <div><a>Settings</a></div>
      <div className='App3'>333 Pikabu</div>
      <Appa />
      <Pepi />
    </div>
  );
}





export default App;
